import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import AdminDashboard from './AdminDashboard'; // تأكد من استيراد صفحة لوحة التحكم
import LoginPage from './'; // تأكد من استيراد صفحة تسجيل الدخول

function App() {
  return (
    <Router>
      <Routes>
        {/* صفحة تسجيل الدخول */}
        <Route path="/login" element={<LoginPage />} />

        {/* لوحة تحكم الأدمن */}
        <Route path="/admin/dashboard" element={<AdminDashboard />} />

        {/* يمكنك إضافة المزيد من الـ Routes هنا حسب الحاجة */}
        <Route path="/" element={<LoginPage />} />  {/* إضافة صفحة تسجيل الدخول كصفحة افتراضية */}
      </Routes>
    </Router>
  );
}

export default App;
